import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const feedback = [
    {
      name: 'Hotline',
      id: '001',
      image: '../images/hotline.png',
      amount: 10,
      added: '2014-01-01'
    },
    {
      name: 'Neon Jungle',
      id: '002',
      image: '../images/neonjungle.png',
      amount: 2,
      added: '2014-01-01'
    },
    {
      name: '3 Hit Pay',
      id: '003',
      large: true,
      image: '../images/3hitpay.png',
      amount: 4,
      added: '2014-01-01'
    },
    {
      name: 'Day of the Dead',
      id: '004',
      image: '../images/dayofthedead.png',
      amount: 2,
      added: '2014-01-01'
    },
    {
      name: 'Dr Jekyll and Mr Hyde',
      id: '005',
      image: '../images/mrjekyll.png',
      amount: 5,
      added: '2014-01-01'
    },
    {
      name: 'Day of the Dead',
      id: '006',
      image: '../images/dayofthedead.png',
      amount: 7,
      added: '2014-01-01'
    },
    {
      name: 'Sea of Tranquility',
      id: '007',
      image: '../images/seaoftranquility.png',
      amount: 2,
      added: '2014-01-01'
    },
    {
      name: 'Aloha',
      id: '008',
      image: '../images/aloha.png',
      amount: 1,
      added: '2014-01-01'
    },
    {
      name: 'Dr Jekyll and Mr Hyde',
      id: '009',
      image: '../images/mrjekyll.png',
      amount: 8,
      added: '2014-01-01'
    },
    {
      name: 'Day of the Dead',
      id: '010',
      image: '../images/dayofthedead.png',
      amount: 11,
      added: '2014-01-01'
    },
  ]

const RatingBox = styled.div`
        margin-top: 50px;
		background-color: #eee;
        padding: 50px 50px;
        text-align: center;
`;

export default function Nav() {

	return (
        <RatingBox>
            <h3 className="font-weight-bold pb-4">
                How did we do?
            </h3>
            <p className="list-details__item grey-text">
                On a scale from 1 - 10, how easy did you find booking your hotel experience?
            </p>
            {feedback.map(game => (
                <div className={game.large ? 'item large' : 'item'} key={game.id}>
                  <img className="img-grid" src={`${game.image}`} alt={`${game.name}`} />
                </div>
              ))}
        </RatingBox>
  	);
}
